INSERT INTO `patient_timeline` (`id`, `patient_id`, `title`, `timeline_date`, `description`, `document`, `status`, `date`, `generated_users_type`, `generated_users_id`) VALUES (46, 191, 'covid-19', '2021-06-19', 'The answer is yes. If you have symptoms of COVID-19, you should get tested for COVID-19 even if you are fully vaccinated. You won\'t be at high risk for hospitalization or severe disease, but if you are infected you may pass the virus to an unvaccinated person, who could then get very sick.The answer is yes. If you have symptoms of COVID-19, you should get tested for COVID-19 even if you are fully vaccinated. You won\'t be at high risk for hospitalization or severe disease, but if you are infected you may pass the virus to an unvaccinated person, who could then get very sick.The answer is yes. If you have symptoms of COVID-19, you should get tested for COVID-19 even if you are fully vaccinated. You won\'t be at high risk for hospitalization or severe disease, but if you are infected you may pass the virus to an unvaccinated person, who could then get very sick.', '46.jpg', 'yes', '2021-06-19', 'staff', 1);
INSERT INTO `patient_timeline` (`id`, `patient_id`, `title`, `timeline_date`, `description`, `document`, `status`, `date`, `generated_users_type`, `generated_users_id`) VALUES (47, 198, 'Google', '2021-06-21', 'When Google maps isn\'t sure about your location, you\'ll see a light blue circle around the blue dot. “Missing activity” means it couldn\'t figure out where you were, or how fast you were traveling, well enough to fill in your timeline. Mostly, it will guess and won\'t always guess correctly.', '', 'yes', '2021-06-21', 'staff', 1);
